// ** React Imports
import { useState, useEffect, useRef, useContext } from 'react'

import { Grid, CardContent, Button, Stack } from '@mui/material'

// ** Icons Imports
import DynamicForm from 'src/views/form/DynamicForm'
import AvatarImage from 'src/views/form/fieldElements/AvatarImage'
import { DynamicFormType } from 'src/types/ComponentsTypes'
import { UserAccountDataType, UserAccountVaildationSchema, UserDataType } from 'src/types/UserType'
import AuthContext, { AuthContextType } from 'src/context/user/user'
import { getWithExpiry } from 'src/utils/utils'

const dynamicFormFields: DynamicFormType[] = [
  {
    name: 'username',
    fieldType: 'text',
    label: '暱稱',
    fullWidth: false
  },
  {
    name: 'nickname',
    fieldType: 'text',
    label: '姓名',
    fullWidth: false
  },
  {
    name: 'email',
    fieldType: 'text',
    label: '信箱',
    fullWidth: false
  },
  {
    name: 'isActive',
    label: '狀態',
    fieldType: 'select',
    fullWidth: false,
    options: [
      { value: 1, label: '活躍' },
      { value: 0, label: '停用' }
    ]
  },
  {
    name: 'title',
    fieldType: 'text',
    label: '職稱',
    fullWidth: false
  }
]

function hexToUrl(hexString) {
  const bytes = []
  for (let i = 0; i < hexString.length; i += 2) {
    bytes.push(parseInt(hexString.substr(i, 2), 16))
  }

  const aa = new Uint8Array(bytes).buffer
  console.log(aa);
  
  const cc = new Blob([aa], { type: 'application/octet-stream' })
  return URL.createObjectURL(cc)
}

const TabAccount = ({ userData, disabled }: { userData: UserDataType; disabled: boolean }) => {
  console.log(
    userData,
    Array.isArray(userData.head_portrait.data),
    10,
    ArrayBuffer.isView(userData.head_portrait.data),
    11
  )
  const bb = hexToUrl('')
  const bufferBlob = new Blob([userData.head_portrait.data], { type: 'application/octet-stream' })
  console.log(bufferBlob, 44)

  const [formField, setFormField] = useState<DynamicFormType[]>()
  const [formData, setFormData] = useState({})
  const [avatarUrl, setAvatarUrl] = useState<string>(bb)
  const [avatarBlob, setAvatarBlob] = useState<Blob>()

  const dynamicFormRef = useRef(null)

  const handleChildSubmit = () => {
    if (!dynamicFormRef.current) return
    dynamicFormRef.current.submitForm()
  }

  const handleChildRest = () => {
    if (!dynamicFormRef.current) return
    dynamicFormRef.current.resetForm()
  }

  const authContext = useContext<AuthContextType>(AuthContext)

  const handleSubmit = async (formData: UserAccountDataType) => {
    const token = getWithExpiry('token')
    const userUpdateData: UserAccountDataType = { ...userData, ...formData, head_portrait: avatarBlob! }
    const { update } = authContext
    await update(userUpdateData, token)
  }

  const handleAvatarChange = (url: string, blob: ArrayBuffer) => {
    setAvatarUrl(url)
    setAvatarBlob(blob)
  }

  useEffect(() => {
    setFormField(dynamicFormFields)

    const { username, nickname, email, isActive, title } = userData
    setFormData({ username, nickname, email, isActive, title })
  }, [userData])

  return (
    <>
      <CardContent sx={{ backgroundColor: disabled ? '#fafafa' : null }}>
        <Grid container spacing={0}>
          <Grid item xs={12} sx={{ marginTop: 4.8, marginBottom: 10 }}>
            <AvatarImage avatarImgUrl={avatarUrl} onChange={handleAvatarChange} disabled={disabled} />
          </Grid>
          <Grid item xs={12} sx={{ marginTop: 4.8, marginBottom: 8 }}>
            {formField && (
              <DynamicForm
                ref={dynamicFormRef}
                fields={formField}
                formData={formData}
                handleSubmitForm={handleSubmit}
                vaildationSchema={UserAccountVaildationSchema}
                disabled={disabled}
              />
            )}
          </Grid>

          <Grid item xs={12} sx={{ marginTop: 4.8, marginBottom: 2 }}>
            <Stack direction={'row'}>
              <Button variant='contained' disabled={disabled} sx={{ marginRight: 3.5 }} onClick={handleChildSubmit}>
                保存
              </Button>
              <Button type='reset' disabled={disabled} variant='outlined' color='secondary' onClick={handleChildRest}>
                重置
              </Button>
              <Button
                type='button'
                disabled={disabled}
                variant='contained'
                color='error'
                sx={{ marginLeft: 'auto', display: 'block' }}
              >
                註銷此帳戶
              </Button>
            </Stack>
          </Grid>
        </Grid>
      </CardContent>
    </>
  )
}

export default TabAccount
